column1:
zu "gesamte Tabelle":
bis 2002: Klassifikation der Wirtschaftszweige, Ausgabe 1993
(WZ 93); ab 2003: Klassifikation der Wirtschaftszweige,
Ausgabe 2003 (WZ 2003)

zu "Betriebe" und "Beschäftigte":
Baden-Württemberg (bis 2007), Bremen (1995, 1996), Bayern:
Monatsdurchschnittswerte;
Baden-Württemberg: Abweichungen in den Summen sind auf das
Runden der Zahlen zurückzuführen;
Berlin (1995 bis 2000): bezogen auf den
Gebietsstand 01.01.2001;
Deutschland: Eventuelle Differenzen zwischen dem Ergebnis
für Deutschland und der Summe der Länder beruhen auf
nachträglichen Ergebniskorrekturen einzelner Länder nach
Aufbereitung und Veröffentlichung des Bundesergebnisses;
Mecklenburg-Vorpommern (2007): Wegen personeller Engpässe
können nur unvollständige Ergebnisse zur Verfügung gestellt
werden;
Sachsen (1995): bezogen auf den Gebietsstand 01.01.1996;
2002: Betriebe mit erweitertem Berichtskreis
